import React, { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";
import { Button, Row, Col, Avatar} from 'antd';
import axios from 'axios';

const AdministracionDeCuentasAjustador = () => {
  const navigate = useNavigate();
  const [nombres, setNombres] = useState('');
  const [apellidos, setApellidos] = useState('');
  const [edad, setEdad] = useState('');
  const [sexo, setSexo] = useState('');
  const [telefono, setTelefono] = useState('');
  const [correo, setCorreo] = useState('');
  // Datos del vehículo
  const [kilometrajeInicial, setkilometrajeInicial] = useState('');
  const [NumeroLLave, setNumeroLLave] = useState('');
  const [ModeloVehiculo, setModeloVehiculo] = useState('');
  const [placas, setPlacas] = useState('');
  const [tajetaGasolina, setTarjetaGasolina] = useState('');
  // Datos del celular
  const [ModeloCelular, setModeloCelular] = useState('');
  const [imei, setIMEI] = useState('');
  const [Numero, setNumero] = useState('');

  const Foto_perfil = localStorage.getItem('Foto_Perfil');
  const [userAvatar, setUserAvatar] = useState(null);

  const nombreCompleto = nombres + " " + apellidos;

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');
    const token = localStorage.getItem('token');

    const obtenerImagenDeUsuario = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`, {
          headers: {
            'Authorization': token
          }
        });
        console.log("Respuesta de la consulta:", response.data);

        if (response.data && response.data.registro && response.data.registro.length > 0) {
          const primerRegistro = response.data.registro[0];
          setNombres(primerRegistro.Nombres);
          setApellidos(primerRegistro.Apellidos);
          setEdad(primerRegistro.Edad);
          setSexo(primerRegistro.Sexo);
          setTelefono(primerRegistro.Telefono);
          setCorreo(primerRegistro.Correo_Electronico);
          // Datos del vehículo
          setkilometrajeInicial(primerRegistro.Kilometraje_Inicial);
          setNumeroLLave(primerRegistro.Numero_De_Llave);
          setModeloVehiculo(primerRegistro.Modelo_Vehiculo);
          setPlacas(primerRegistro.Placa_Vehiculo);
          setTarjetaGasolina(primerRegistro.Tarjeta_Gasolina);
          // Datos del celular
          setModeloCelular(primerRegistro.Modelo_Celular);
          setIMEI(primerRegistro.IMEI);
          setNumero(primerRegistro.Telefono_Celular_Asignado);
          //obtenerla imagen deperfio 
          const nombreImagen = Foto_perfil;
          setUserAvatar(`http://localhost:8000/images/${nombreImagen}`);

        } else {
          console.error('No se encontraron datos válidos en la respuesta');
        }
      } catch (error) {
        console.error('Error al obtener la información del ajustador:', error);
      }
    };

    obtenerImagenDeUsuario();
  }, []);



  const defaultAvatarUrl = 'https://static.vecteezy.com/system/resources/previews/005/337/799/non_2x/icon-image-not-found-free-vector.jpg';

  const renderAvatar = (imagen) => (
    <Avatar size={150} src={imagen || defaultAvatarUrl} style={{ cursor: 'pointer' }} />
  );

  return (
    <div style={{ position: 'relative', minHeight: '100vh', backgroundColor: '#FA5568' }}>
      {/* Fondo con medio círculo semi-transparente */}
      <div style={{ position: 'absolute', top: '-50px', left: 0, right: 0, height: '100px', backgroundColor: 'rgba(24, 144, 255, 0.2)', borderRadius: '0 0 50% 50%', zIndex: -1 }}></div>
      
      <div style={{ padding: '20px', textAlign: 'center' }}>
        <h1 style={{ marginBottom: '30px', color: '#1890ff' }}>Administración de Cuentas de Ajustador</h1>
        <div style={{ position: 'relative', marginBottom: '1rem'}}>
          {renderAvatar(userAvatar)} {/* Renderizar el avatar con la imagen de perfil */}
        </div>
        <Row justify="center">
          <Col xs={24} sm={20} md={16} lg={12} xl={10}>
            <div style={{ background: 'rgba(255, 255, 255, 0.8)', padding: '20px', boxShadow: '0 4px 8px rgba(0,0,0,0.1)', borderRadius: '8px', textAlign: 'left' }}>
              <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Datos del usuario</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Nombre del usuario: {nombreCompleto}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Edad: {edad} años</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Sexo: {sexo}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Teléfono: {telefono}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Correo electrónico: {correo}</p>
              <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Datos del vehículo asignado</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Kilometraje inicial: {kilometrajeInicial}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Modelo del vehículo: {ModeloVehiculo}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Placas: {placas}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Número de TAG: {NumeroLLave}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Tarjeta de gasolina asignada: {tajetaGasolina}</p>
              <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Datos del teléfono asignado</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Modelo del celular: {ModeloCelular}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Clave IMEI: {imei}</p>
              <p style={{ fontSize: '1rem', marginBottom: '10px' }}>Número de teléfono: {Numero}</p>
              <div style={{ textAlign: 'center', marginTop: '20px' }}>
                <Button type="primary" onClick={handleLogout}>
                  Cerrar Sesión
                </Button>
              </div>
            </div>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default AdministracionDeCuentasAjustador;
